message:
Segue firme o fenômeno dos aviões parados no tempo.

Sul do Brasil.

 @AnalisandoOsFatos

Sobre o fenômeno.

Aí pode entrar a questão da tal teoria copiada do Einstein, que o tempo depende do movimento de cada corpo. O fenômeno de lapso do tempo só ocorreria em uma determinada condição de velocidade e distância dos dois objetos.

@AnalisandoOsFatos
